import React from 'react';
import './App.css';
import TodoItem from './TodoItem'
import todoData from './todoData'


function App() {

  const TodoItem = todoData.map(item => <TodoItem key={item.id} item={item}/>)

  return (
    <div>
    {TodoItem}

    </div>
  )
}

export default App;
